import{_ as e,o as t,c as o,O as r}from"./chunks/framework.9482e208.js";const f=JSON.parse('{"title":"§ 58.1-3606.1 Property indirectly owned by government.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/58.1-3606.1.md","filePath":"vacode/58.1-3606.1.md"}'),i={name:"vacode/58.1-3606.1.md"},a=r('<h1 id="§-58-1-3606-1-property-indirectly-owned-by-government" tabindex="-1">§ 58.1-3606.1 Property indirectly owned by government. <a class="header-anchor" href="#§-58-1-3606-1-property-indirectly-owned-by-government" aria-label="Permalink to &quot;§ 58.1-3606.1 Property indirectly owned by government.&quot;">​</a></h1><p>Property indirectly owned by the Commonwealth or any political subdivision thereof or by the United States shall include, but not be limited to, a leasehold interest or other right pursuant to a concession, as defined in § <a href="http://law.lis.virginia.gov/vacode/33.2-1800/" target="_blank" rel="noreferrer">33.2-1800</a>, in a transportation facility and real property acquired or constructed for the development and/or operation of the qualifying transportation facility when (i) the qualifying transportation facility is owned, or title to it is held, by the Commonwealth or any political subdivision thereof or by the United States and is being developed and/or operated pursuant to a concession under the Public-Private Transportation Act of 1995 (§ <a href="http://law.lis.virginia.gov/vacode/33.2-1800/" target="_blank" rel="noreferrer">33.2-1800</a> et seq.) or similar federal law and (ii) the property or leasehold interest is required to be dedicated to the Commonwealth, its political subdivision, or the United States upon the termination of the concession.</p><p>2006, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?061+ful+CHAP0922" target="_blank" rel="noreferrer">922</a>.</p>',3),n=[a];function d(l,s,c,p,h,_){return t(),o("div",null,n)}const m=e(i,[["render",d]]);export{f as __pageData,m as default};
